import "./conversationScreen.css";
import "./usersList.css";
import { useState, useEffect } from "react";
import Content from "./content";
function UsersList() {
  const [clients, setClients] = useState(false);
  const [coachs, setCoachs] = useState(false);
  const [sup, setSup] = useState(false);
  function ChooseClient() {}
  function ChooseCoach() {
    useEffect(() => {
      setClients(false);
      setCoachs(true);
      setSup(false);
      console.log(coachs);
    }, []);
  }
  function ChooseSup() {
    useEffect(() => {
      setClients(false);
      setCoachs(false);
      setSup(true);
      console.log(sup);
    }, []);
  }

  return (
    <div className="usersListWrapper">
      <div id="cover">
        <form method="get" action="">
          <div class="tb">
            <div class="td">
              <input type="text" placeholder="Search" required />
            </div>
            <div class="td" id="s-cover">
              <button type="submit">
                <div id="s-circle"></div>
                <span></span>
              </button>
            </div>
          </div>
        </form>
      </div>
      <div className="usersType">
        <div>
          <div className="clicked">Clients</div>
        </div>
        <div className="type">Coachs</div>
        <div className="type">Superviseurs</div>
      </div>
      <div className="scrollConnect">
        <Content />
        <Content />
        <Content />
        <Content />
        <Content />
        <Content />
        <Content />
      </div>
    </div>
  );
}
export default UsersList;
